import React from "react";

const Home = () => {
    return (
        <>
            <main class="my-5">
                <div class="container shadow-lg">
                    <section class="text-center">
                        <h2 class="mb-5 my-3">
                            <strong>Latest Posts</strong>
                        </h2>
                    </section>
                </div>
            </main>
        </>
    );
};

export default Home;
